import React from "react";
import { useDispatch, useSelector } from "react-redux";

const FilterOrigin = () => {
    // Redux 
    const store = useSelector(state => state.productsSlice)
    const origins = [];
    for (let i of store.products) {
        if (!origins.includes(i.origin)) {
            origins.push(i.origin)
        }
    }
    console.log(origins)
    return (
        <div className="selectOrigin">
            {
                origins.map(origin => 
                    <div className="originList">
                        <input type="checkbox" />
                        <label htmlFor="origin">{origin.toUpperCase()}</label>
                    </div>    
                )
            }
        </div>
    )
}

export default FilterOrigin
